window.bookSummaryJSON = "<p>Jack, Lex, Haylee, and a young hero with a unique class on loan from Ivyset Crag go on an odyssey to explore the unreachable tower on the furthest edge of the map. With no dock listed on any system interface, the NPCs of Mother Sana design a custom boat built out of logs, fruit, and indestructible equipment drops to make the trip.<br> <br> The Dark Prism and Blackmoor Kingdom’s Royal Advisor has a hunch that the first climbing party bold enough to reach beyond their stagnant ways and explore the only unclaimed tower in the middle of the ocean will reap special rewards.<br> <br> There’s only one way to find out....<br> <br> About 96,000 words</p>"; 
